,(6942,'LAYER3','1','RMP','RM30',330,'<b>Supervision</b><br/>Who will they see, when and why? Include frequency of reporting and any engagement with community resources to build social capital and encourage desistance. Do they have support from family or friends? How can that be supported?','N','1','RMP','RM36',NULL,NULL,'LAYER3',NULL,TIMESTAMP '2020-06-30 16:22:17.000000','SYS',TIMESTAMP '2020-06-30 16:22:17.000000','SYS',NULL)
,(6943,'LAYER3','1','RMP','RM31',340,'<b>Monitoring and Control</b><br/>What restrictions will be in place to restrict their ability to offend? What steps can be taken to monitor the key risk factors in the case? How will that information be reported and collated and who by? Record here <b>all licence conditions/community order requirements/PPM restrictions used to monitor the person</b> or restrict their actions and movements. Not those related to programmes or victim protection.','N','1','RMP','RM36',NULL,NULL,'LAYER3',NULL,TIMESTAMP '2020-06-30 16:22:17.000000','SYS',TIMESTAMP '2020-06-30 16:22:17.000000','SYS',NULL)
