,(6945,'LAYER3','1','RMP','RM32',360,'<b>Interventions and Treatment</b><br/>What interventions will be delivered to develop internal controls and build the protective factors that you have identified would reduce risk? What practical support will be offered? Is there a role for psychological treatment? When will intervention or treatment be delivered and by whom? What <b>licence conditions/community order requirements/restrictions are required to support interventions</b> and what steps need to be taken to implement these interventions?','N','1','RMP','RM36',NULL,NULL,'LAYER3',NULL,TIMESTAMP '2020-06-30 16:22:17.000000','SYS',TIMESTAMP '2020-06-30 16:22:17.000000','SYS',NULL)
,(6946,'LAYER3','1','RMP','RM33',370,'<b>Victim Safety Planning</b><br/>What restrictions are in place to specifically protect the victim, and those known adults or children assessed to be at risk from the Offender? Record all details of plans that protect them, being mindful about issues about disclosure. <b>Licence conditions/community order requirements/restrictions related to named individuals or exclusion zones designed to protect specific victims should be recorded here.</b>','N','1','RMP','RM36',NULL,NULL,'LAYER3',NULL,TIMESTAMP '2020-06-30 16:22:17.000000','SYS',TIMESTAMP '2020-06-30 16:22:17.000000','SYS',NULL)
