,(6948,'LAYER3','1','RMP','RM34',390,'<b>Contingency Plans</b><br/>Contingency plans should be in the format <b>...if X happens we will do Y...</b> What steps will be taken to address the circumstances that you have identified would increase the risk of serious harm if they take place? What will you do if parts of the plan were to break down? What will the response be to breach of licence conditions/community order requirements/restrictions? Who will take those actions and in what timescale?<br/><br/>When developing contingency plans consider what role increased supervision, additional monitoring/control or greater intervention might play when a trigger is detected. Additionally consider whether following the trigger greater protection is needed for those named individuals or groups at risk.','N','1','RMP','RM36',NULL,NULL,'LAYER3',NULL,TIMESTAMP '2020-06-30 16:22:17.000000','SYS',TIMESTAMP '2020-06-30 16:22:17.000000','SYS',NULL)
